import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Navbar.css'

import React from 'react';
import { toBeRequired } from '@testing-library/jest-dom/dist/matchers';
import { getDropdownMenuPlacement } from 'react-bootstrap/esm/DropdownMenu';
import { hover } from '@testing-library/user-event/dist/hover';

function App() {  
  const style1={color:"darkgreen",padding:"20px",fontSize:"20px"};
  const style2={color:"darkgreen",fontSize:"20px",padding:"12px",};
  const style3={paddingRight:"0px"};
  return (  
    <Navbar bg="light" expand="md">  
    <Container>  
      <Navbar.Brand  href="#home"><img style={style3} src={require('./logo.jpg')} alt='logo' height={100} width={200} /></Navbar.Brand> 
      <br>
      </br> 
      <Navbar.Toggle aria-controls="basic-navbar-nav" />  
      <Navbar.Collapse id="basic-navbar-nav">  
        <Nav className="me-auto">  
          <Nav.Link style={style1} href="#home">Home</Nav.Link>  
          <Nav.Link style={style1} href="#link">About</Nav.Link>  
          <NavDropdown  bg="light" style={style2} title="Top Cities" id="basic-nav-dropdown">  
            <NavDropdown.Item className="block" style={{fontSize:20}} style={{width:20}}  href="#action/3.1">Chennai</NavDropdown.Item>  
            <NavDropdown.Item className="block" style={{fontSize:20}} href="#action/3.2">Madurai</NavDropdown.Item>  
            <NavDropdown.Item className="block" style={{fontSize:20}} href="#action/3.3">Erode</NavDropdown.Item>  
             
            <NavDropdown.Item className="block" style={{fontSize:20}} href="#action/3.4">Salem</NavDropdown.Item>  
          </NavDropdown>
          <Nav.Link style={style1} href="#link">Help</Nav.Link>
          <Nav.Link style={style1} href="#link">Contact</Nav.Link>  
        </Nav>  
      </Navbar.Collapse>  
    </Container>  
  </Navbar>  
  );  
}  
export default App;
